import './carousel.css';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import {Carousel} from 'react-responsive-carousel';

function Carousels(){
    return(
        <div>
            <h1>Hello</h1>
            <Carousel infiniteloop autoPlay></Carousel>
        </div>
    )
}

export default Carousels;
